$(document).ready(function () {
    var orderdate;
    var orderid;
    var totalAmount;
    var status;
    var paymentMethod;
    var mobileUsed;
    var couponCodeGenerated;

    $.ajax({
        type: 'get',
        //dataType: "json",
        url: "/web-selfcare/payment/receipt-data",
        success: function (result) {
            orderdate = result[0].orderDate;
            orderid = result[0].orderId;
            totalAmount = result[0].amount;
            status = result[0].orderStatus;
            paymentMethod = result[0].paymentOption;
            mobileUsed = result[0].usedMobile;
            couponCodeGenerated = result[0].newCouponCode;

            $("#lbl-rec-orderDate").text(orderdate);
            $("#lbl-rec-orderId").text(orderid);
            $("#lbl-rec-amount").text(totalAmount);
            $("#lbl-rec-status").text(status);
            $("#lbl-rec-paymentOption").text(paymentMethod);
            $("#lbl-rec-usedMobile").text(mobileUsed);
            $("#lbl-rec-newCoupon").text(couponCodeGenerated);
        }
    });

    $("#btn-print").click(function () {
        var doc = new jsPDF();

        var imgData = 'data:image/png;base64,';
        doc.addImage(imgData, 'JPEG', 80, 10, 50, 50);

        doc.setFont("helvetica");
        doc.setFontType("bold");
        doc.setFontSize(22);
        doc.text('Order Details', 80, 75);

        doc.setFontType("normal");
        doc.text('___________', 81, 76);

        doc.setFontSize(16);
        doc.text('Thank you for your online food order. Order details are shown below.', 10, 90)
        doc.text('.............................................................................................................',10,95)

        doc.setFont("courier");
        doc.text('Order date/time: ' + orderdate, 10, 105);
        doc.text('Order id: ' + orderid, 10, 115);
        doc.text('Amount (Rs.): ' + totalAmount, 10, 125);
        doc.text('Status: ' + status, 10, 135);
        doc.text('Payment option: ' + paymentMethod, 10, 145);
        doc.text('Used mobile: ' + mobileUsed, 10, 155);
        doc.text('New coupon code: ' + couponCodeGenerated, 10, 165);

        doc.setFont("helvetica");
        doc.text('.............................................................................................................',10,172)

        doc.setFontType("normal");
        doc.setFontSize(16);
        doc.text('You may use the coupon code metioned above in your next order.', 10, 182);
        doc.text('Please contact us if there is any mistake in the above details.', 10, 191)

        doc.text('_______________________________________________________',10,195)

        doc.setFont("courier");
        doc.setFontSize(12);
        doc.text('Printed on: ' + new Date(), 10, 205);

        doc.save('Order_' + orderid + '_receipt.pdf');
    });
});
